import React from 'react';
import Card from 'react-bootstrap/Card';

function SystemLogCard(props) {

    const data = "This is the log and this is the second log line";

    return(
        <Card bg="dark" text="white" fluid>
            <Card.Header> System Log </Card.Header>
            <Card.Body>
                <Card.Title> System Lag </Card.Title>
                <Card.Text>
                    {data}}
                </Card.Text>
            </Card.Body>
        </Card>
    );
}

export default SystemLogCard;
